472,5,1,#:Event_If_EventState 999 6 0:#:Event_RebornMonster 130 5 7:Event_EventState 470 5 0:,終於走到最後,
470,5,1,#:Event_If_EventState 999 6 0:#:Event_RebornMonster 130 6 8:Event_RebornMonster 136 5 7:Event_RebornMonster 137 5 7:Event_RebornMonster 107 6 8:Event_RebornMonster 108 6 8:Event_TriggerEvent 480 1 0:Event_EventState 470 6 0:,維多跟卡瑞莎往前走治療蝶精族長,
