481,5,1,#:Event_If_EventState 999 6 0:#:Event_MonsterAction 136 821 102921 3 57 0:Event_TriggerEvent 483 3 0:,族長！你沒事吧？,
482,5,1,#:Event_If_EventState 999 6 0:#:Event_MonsterAction 137 821 102920 3 57 0:Event_RebornFaceDir 136 180 0:Event_RebornFaceDir 137 315 0:Event_TriggerEvent 481 2 0:,嗯…剛剛那個惡魔呢？,
483,5,1,#:Event_If_EventState 999 6 0:#:Event_MonsterAction 135 0 102922 3 57 0:Event_TriggerEvent 484 3 0:,你們來了嗎？那個惡魔…他突然就出現了。,
484,5,1,#:Event_If_EventState 999 6 0:#:Event_MonsterAction 135 0 102923 3 57 0:Event_TriggerEvent 485 4 0:,咳咳…。,
485,5,1,#:Event_If_EventState 999 6 0:#:Event_MonsterAction 136 824 102924 3 57 0:Event_TriggerEvent 486 3 0:,不行，已經失去意識了，我必須要治療他。,
486,5,1,#:Event_If_EventState 999 6 0:#:Event_MonsterAction 137 821 102925 3 57 0:Event_TriggerEvent 487 3 0:,卡瑞莎你先進行治療，一切等他醒來再說吧。,
487,5,1,#:Event_If_EventState 999 6 0:#:Event_MonsterAction 136 821 102926 3 57 0:Event_TriggerEvent 488 3 0:,嗯…我需要一個人幫忙。,
