491,5,1,#:Event_If_EventState 999 6 0:#:Event_ShowMessage 25257 13 17:Event_RebornMonster 135 6 8:Event_RebornMonster 144 5 7:Event_GiveBuff 13 0 45381 14:Event_TriggerEvent 492 4 0:,維多利亞的戒指開始發光，一道閃光後卡瑞莎與維多利亞交換了位置,
