493,5,1,#:Event_If_EventState 999 6 0:#:Event_ShowMessage 25259 13 17:Event_RebornMonster 141 5 7:Event_RebornMonster 142 5 7:Event_RebornMonster 143 5 7:,與維多利亞一起擊敗惡魔領主。,
