501,5,1,#:Event_If_EventState 999 6 0:#:Event_MonsterAction 145 0 849 3 57 0:Event_TriggerEvent 502 3 0:,王怪145被打敗發話849,
502,5,1,#:Event_If_EventState 999 6 0:#:Event_MonsterAction 141 821 103194 3 57 0:Event_TriggerEvent 503 3 0:,先別殺了他，我去看看卡瑞莎怎麼樣了。,
