505,6,1,#:Event_If_EventState 999 6 0:#:Event_MonsterAction 141 821 103195 3 57 0:Event_RebornMonster 147 6 8:Event_TriggerEvent 506 3 0:Event_EventState 505 6 0:,卡瑞莎！你沒事吧？,
506,5,1,#:Event_If_EventState 999 6 0:#:Event_MonsterAction 148 828 103196 3 57 0:Event_TriggerEvent 507 3 0:,沒事，頭有點暈而已…,
507,5,1,#:Event_If_EventState 999 6 0:#:Event_MonsterAction 148 829 103197 4 57 0:Event_TriggerEvent 508 3 0:,只是…你給我的那個項鍊…碎掉了…,
508,5,1,#:Event_If_EventState 999 6 0:#:Event_MonsterAction 141 824 103198 4 57 0:Event_TriggerEvent 509 4 0:,哦…那跟我的這個戒指是成對的，持有者必要時可以藉由兩者交換位置。,
509,5,1,#:Event_If_EventState 999 6 0:#:Event_MonsterAction 148 0 103199 4 57 0:Event_TriggerEvent 510 4 0:,呃…我不是說那個…,
510,5,1,#:Event_If_EventState 999 6 0:#:Event_MonsterAction 141 821 103200 3 57 0:Event_TriggerEvent 511 3 0:,嗯？這是魔法部門最新研發的樣品，聽說只是偶然成功製作出來的。,
511,5,1,#:Event_If_EventState 999 6 0:#:Event_MonsterAction 141 0 103201 3 57 0:Event_TriggerEvent 512 3 0:,現在用掉了，可能之後也做不出來了吧。,
512,5,1,#:Event_If_EventState 999 6 0:#:Event_MonsterAction 148 827 103202 3 57 0:Event_TriggerEvent 513 2 0:,咦…那這樣…最新的研究…,
513,5,1,#:Event_If_EventState 999 6 0:#:Event_MonsterAction 141 821 103203 3 57 0:Event_TriggerEvent 514 3 0:,沒關係，你沒事就好，他們肯給我這個代表那邊不用擔心。,
514,5,1,#:Event_If_EventState 999 6 0:#:Event_MonsterAction 141 824 103204 3 57 0:Event_RebornFaceDir 141 270 0:Event_RebornPatrol 141 149 0:Event_TriggerEvent 515 2 0:,總之，現在把那個惡魔帶回去吧…必須要得到更詳細的情報。,
515,5,1,#:Event_If_EventState 999 6 0:#:Event_MonsterAction 148 0 103205 3 57 0:Event_TriggerEvent 516 2 0:,…謝謝你…維多利亞。,
516,5,1,#:Event_If_EventState 999 6 0:#:Event_RebornPatrol 148 150 0:,卡瑞莎跟著維多莉亞走,
